"A slicked and suspendered male bartender is serving you a pristine Manhattan in an etched-glass coupe from behind a dark bar in a hidden location you had to hear about through a friend of a friend. It is 1934. No, wait—it is 2001. Or is it 2021?" ⁠
⁠
@scotthocker examines cocktail culture's obsession with the so-called Golden Age of Cocktails (the mid-1800s until Prohibition) and why this fixation disregards the people and perceptions that were outsiders to that moment. Plus, a glimpse into the future could look like. Link in bio. #drinkpunch 🎨: @malloryheyer
